--------------------------------------------------------
--  DDL for Procedure PROC_CREATE_INVOICE_INIT
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "PROC_CREATE_INVOICE_INIT" (rtn out integer) is--rtn 1:错误 0:正确
rsCursor SYS_REFCURSOR;
rsCursor1 SYS_REFCURSOR;
an_merchant_id number(10);--商户ID
an_merchant_branch_id number(10);--门店ID
an_settle_period number(10);--结算周期
an_settle_type number(10);--结算方式
an_settle_upperlimit number(10,3);--结算金额上限
ad_settle_startdate date;--结算开始日期
ai_settle_date integer;--结算日
ai_check_date integer;--对帐日
an_handling_charge number(4,3);--手续费 千分比
an_commision_charge number(4,3);--佣金 千分比
an_discount_rate number(4,3);--折扣系数 千分比


ai_count integer;
a_count integer;
a_invoice_date date;
a_invoice_start date;
a_invoice_end date;

a2_invoice_date date;
a2_invoice_start date;
a2_invoice_end date;

begin
  rtn:=0;
  open rscursor for 
       select a.merchant_id,a.settle_period,a.settle_type,a.settle_upperlimit,
              a.settle_startdate,a.settle_date,a.check_date,a.handling_charge,a.commision_charge,a.discount_rate 
       from rfms_merchant a
       where a.status='1'
       and a.audit_status=8;
  loop 
      ai_count:=0;
      a_count:=0;
      a_invoice_date:=null;
      a_invoice_start:=null;
      a_invoice_end:=null;

      a2_invoice_date:=null;
      a2_invoice_start:=null;
      a2_invoice_end:=null;

       fetch rscursor into an_merchant_id,an_settle_period,an_settle_type,
                           an_settle_upperlimit,ad_settle_startdate,ai_settle_date,ai_check_date,
                           an_handling_charge,
                           an_commision_charge,an_discount_rate; 
       exit when rscursor%notfound;
       select count(*) into ai_count 
       from rfms_invoice_record a 
       where a.merchant_id=an_merchant_id
       and a.finish_flag='0'
       and to_char(a.invoice_date,'yyyy-mm-dd')>=to_char(sysdate,'yyyy-mm-dd');
       if ai_count is null then
          ai_count:=0;
       end if;

       /*判断商户是否有未计算且计算期大于当日的计算记录*/
       if ai_count=0 then
         begin
          loop
            select count(*)
            into a_count
            from rfms_invoice_record a
            where a.id=(select max(b.id) from rfms_invoice_record b 
                        where b.merchant_id=a.merchant_id
                        and a.merchant_id=an_merchant_id);
            if a_count > 0 then
              select a.invoice_date,a.invoice_start,a.invoice_end
              into a_invoice_date,a_invoice_start,a_invoice_end
              from rfms_invoice_record a
              where a.id=(select max(b.id) from rfms_invoice_record b 
                          where b.merchant_id=a.merchant_id
                          and a.merchant_id=an_merchant_id);
            end if;

            exit when a_invoice_end > sysdate;
            /*新商户创建至今日的所有结算空记录*/
            
           --所有的商户都是以月为单位开票的
           if ai_check_date<1 or ai_check_date > 28 then--商户开票日设置错误
              rtn:=1;
              exit;
           end if;
           if a_invoice_date is null then
              a2_invoice_date:=to_date(to_char(add_months(ad_settle_startdate,1),'yyyy-mm')||'-'||ai_check_date,'yyyy-mm-dd');
              a2_invoice_start:=ad_settle_startdate;
              a2_invoice_end:=to_date(to_char(add_months(ad_settle_startdate,1),'yyyy-mm')||'-'||ai_check_date,'yyyy-mm-dd');
           else
              a2_invoice_date:=add_months(a_invoice_end,1);
              a2_invoice_start:=a_invoice_end;
              a2_invoice_end:=add_months(a_invoice_end,1);
           end if;

            --生成商户结算记录
            insert into rfms_invoice_record(id,merchant_id,invoice_date,
                                          invoice_start,invoice_end,handling_charge,
                                          commision_charge,discount_rate,finish_flag)
            values(seq_rfms_settle_record.nextval,an_merchant_id,
                   a2_invoice_date,a2_invoice_start,a2_invoice_end,
                   an_handling_charge,an_commision_charge,an_discount_rate,'0');

            --生成商户分店结算记录
            open rscursor1 for 
               select b.merchant_branch_id
               from rfms_merchant a,rfms_merchant_branch b
               where a.status='1'
               and a.merchant_id=b.merchant_id
               and a.merchant_id=an_merchant_id;
            loop 
               fetch rscursor1 into an_merchant_branch_id; 
               exit when rscursor1%notfound;
               
               insert into rfms_invoice_branch_record(id,invoice_record_id,merchant_id,
                                                     merchant_branch_id,invoice_date,
                                                     invoice_start,invoice_end,handling_charge,
                                                     commision_charge,discount_rate)
               values(seq_rfms_settle_branch_record.nextval,seq_rfms_settle_record.currval,
                      an_merchant_id,an_merchant_branch_id,
                      a2_invoice_date,a2_invoice_start,a2_invoice_end,
                      an_handling_charge,an_commision_charge,an_discount_rate);
             end loop;
                                   
          end loop;
         end;
       end if;
  commit;
  end loop;
  EXCEPTION 
    WHEN OTHERS THEN
      rollback; 
      rtn:=1;
      prc_err_log(an_merchant_id,'proc_create_invoice_init','初始化商户应开票空记录');
      Commit; 
end proc_create_invoice_init;

/

--------------------------------------------------------
--  DDL for Procedure PROC_CREATE_INVOICE_RECORD
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "PROC_CREATE_INVOICE_RECORD" (rtn out integer) is
rsCursor SYS_REFCURSOR;
rsCursor1 SYS_REFCURSOR;
a_merchant_id number(10);
a_sys_merchant_code varchar2(255);
a_settle_upperlimit number(19);
a_invoice_id number(10);
a_invoice_date date;
a_invoice_start date;
a_invoice_end date;
a_handling_charge number(4,3);
a_commision_charge number(4,3);
a_discount_rate number(4,3);

a1_sum_consume number(19);
a1_sum_consume_amount number(19);
a1_sum_reject number(19);
a1_sum_reject_amount number(19);
a1_sum_amount number(19);

a1_handling_amount number(19);
a1_commision_amount number(19);
a1_discount_amount number(19);

a_invoice_branch_id number(10);

begin
  rtn:=0;

  --填写商户分店结算数据
  open rscursor1 for 
       select a.sys_merchant_code,
              b.id,b.invoice_date,b.invoice_start,b.invoice_end,
              b.handling_charge,b.commision_charge,b.discount_rate
       from rfms_merchant_branch a,rfms_invoice_branch_record b,rfms_invoice_record c
       where a.merchant_branch_id=b.merchant_branch_id
       and b.invoice_record_id=c.id
       and c.finish_flag='0'
       and b.invoice_date<=sysdate;
  loop 
       fetch rscursor1 into a_sys_merchant_code,
                           a_invoice_branch_id,a_invoice_date,a_invoice_start,a_invoice_end, 
                           a_handling_charge,a_commision_charge,a_discount_rate; 
       exit when rscursor1%notfound;
       
       select sum(a.tradecount),abs(sum(a.realamount)) into a1_sum_consume,a1_sum_consume_amount 
        from tbl_clearingresults a
        where a.trade_status=1
        and a.recorddate >= a_invoice_start
        and a.recorddate < a_invoice_end
        and a.org_id in (select b.id from tbl_organization b 
                     where trim(b.uniqueid) =trim(a_sys_merchant_code)
                     );
 
       select sum(a.tradecount),abs(sum(a.realamount)) into a1_sum_reject,a1_sum_reject_amount 
        from tbl_clearingresults a
        where a.trade_status=12
        and a.recorddate >= a_invoice_start
        and a.recorddate < a_invoice_end
        and a.org_id in (select b.id from tbl_organization b 
                     where trim(b.uniqueid) =trim(a_sys_merchant_code)
                     );
 
          if a1_sum_consume_amount is null then
             a1_sum_consume:=0;
             a1_sum_consume_amount:=0;
          end if;
          if a1_sum_reject_amount is null then
             a1_sum_reject:=0;
             a1_sum_reject_amount:=0;
          end if;
          a1_sum_amount:=a1_sum_consume_amount-a1_sum_reject_amount;
          a1_handling_amount:=a1_sum_amount*a_handling_charge;
          a1_commision_amount:=a1_sum_amount*a_commision_charge;
          a1_discount_amount:=a1_sum_amount*(1-a_discount_rate);

          a1_sum_amount:=a1_sum_amount-a1_handling_amount-a1_commision_amount-a1_discount_amount;

          update rfms_invoice_branch_record a
          set a.amount=a1_sum_amount,
              a.handling_charge_amount=a1_handling_amount,
              a.commision_charge_amount=a1_commision_amount,
              a.discount_amount=a1_discount_amount,
              a.consume_num=a1_sum_consume,
              a.consume_amount=a1_sum_consume_amount,
              a.rejected_num=a1_sum_reject,
              a.rejected_amount=a1_sum_reject_amount
          where id=a_invoice_branch_id;
  end loop;  
    --填写商户结算数据
  open rscursor for 
       select a.merchant_id,a.sys_merchant_code,a.settle_upperlimit,
              b.id,b.invoice_date,b.invoice_start,b.invoice_end,
              b.handling_charge,b.commision_charge,b.discount_rate
       from rfms_merchant a,rfms_invoice_record b
       where a.merchant_id=b.merchant_id
       and b.finish_flag='0'
       and b.invoice_date<=sysdate;
  loop 
       fetch rscursor into a_merchant_id,a_sys_merchant_code,a_settle_upperlimit,
                           a_invoice_id,a_invoice_date,a_invoice_start,a_invoice_end,
                           a_handling_charge,a_commision_charge,a_discount_rate; 
       exit when rscursor%notfound;
       
       select sum(a.tradecount),abs(sum(a.realamount)) into a1_sum_consume,a1_sum_consume_amount 
        from tbl_clearingresults a
        where a.trade_status=1
        and a.recorddate >= a_invoice_start
        and a.recorddate < a_invoice_end
        and a.org_id in (select b.id from tbl_organization b 
                     where trim(b.uniqueid) in (select trim(c.sys_merchant_code) 
                                          from rfms_merchant_branch c,rfms_invoice_branch_record d
                                          where c.merchant_branch_id=d.merchant_branch_id
                                          and d.invoice_record_id=a_invoice_id)
                     );
 
       select sum(a.tradecount),abs(sum(a.realamount)) into a1_sum_reject,a1_sum_reject_amount 
        from tbl_clearingresults a
        where a.trade_status=12
        and a.recorddate >= a_invoice_start
        and a.recorddate < a_invoice_end
        and a.org_id in (select b.id from tbl_organization b 
                     where trim(b.uniqueid) in (select trim(c.sys_merchant_code) 
                                          from rfms_merchant_branch c,rfms_invoice_branch_record d
                                          where c.merchant_branch_id=d.merchant_branch_id
                                          and d.invoice_record_id=a_invoice_id)
                     );
 
          if a1_sum_consume_amount is null then
             a1_sum_consume:=0;
             a1_sum_consume_amount:=0;
          end if;
          if a1_sum_reject_amount is null then
             a1_sum_reject:=0;
             a1_sum_reject_amount:=0;
          end if;
          a1_sum_amount:=a1_sum_consume_amount-a1_sum_reject_amount;
          a1_handling_amount:=a1_sum_amount*a_handling_charge;
          a1_commision_amount:=a1_sum_amount*a_commision_charge;
          a1_discount_amount:=a1_sum_amount*(1-a_discount_rate);

          a1_sum_amount:=a1_sum_amount-a1_handling_amount-a1_commision_amount-a1_discount_amount;

          update rfms_invoice_record a
          set a.amount=a1_sum_amount,
              a.handling_charge_amount=a1_handling_amount,
              a.commision_charge_amount=a1_commision_amount,
              a.discount_amount=a1_discount_amount,
              a.consume_num=a1_sum_consume,
              a.consume_amount=a1_sum_consume_amount,
              a.rejected_num=a1_sum_reject,
              a.rejected_amount=a1_sum_reject_amount,
              a.finish_time=sysdate,
              a.finish_flag='1'
          where id=a_invoice_id;
  commit;
  end loop;

  EXCEPTION 
    WHEN OTHERS THEN
      rollback; 
      rtn:=1;
      prc_err_log(a_merchant_id,'proc_create_invoice_record','生成商户发票报表');
      Commit; 
  
end proc_create_invoice_record;

