--------------------------------------------------------
--  DDL for Procedure PROC_CREATE_SETTLE_INIT
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "PROC_CREATE_SETTLE_INIT" (rtn out integer) is--rtn 1:错误 0:正确
rsCursor SYS_REFCURSOR;
rsCursor1 SYS_REFCURSOR;
an_merchant_id number(10);--商户ID
an_merchant_branch_id number(10);--门店ID
an_settle_period number(10);--结算周期
an_settle_type number(10);--结算方式
an_settle_upperlimit number(10,3);--结算金额上限
ad_settle_startdate date;--结算开始日期
ai_settle_date integer;--结算日
ai_check_date integer;--对帐日
an_handling_charge number(4,3);--手续费 千分比
an_commision_charge number(4,3);--佣金 千分比
an_discount_rate number(4,3);--折扣系数 千分比


ai_count integer;
a_count integer;
a_settle_date date;
a_settle_start date;
a_settle_end date;

a2_settle_date date;
a2_settle_start date;
a2_settle_end date;

begin
  rtn:=0;
  open rscursor for 
       select a.merchant_id,a.settle_period,a.settle_type,a.settle_upperlimit,
              a.settle_startdate,a.settle_date,a.handling_charge,a.commision_charge,a.discount_rate 
       from rfms_merchant a
       where a.status='1'
       and a.audit_status=8;
  loop 
      ai_count:=0;
      a_count:=0;
      a_settle_date:=null;
      a_settle_start:=null;
      a_settle_end:=null;

      a2_settle_date:=null;
      a2_settle_start:=null;
      a2_settle_end:=null;

       fetch rscursor into an_merchant_id,an_settle_period,an_settle_type,
                           an_settle_upperlimit,ad_settle_startdate,ai_settle_date,an_handling_charge,
                           an_commision_charge,an_discount_rate; 
       exit when rscursor%notfound;
       select count(*) into ai_count 
       from rfms_settle_record a 
       where a.merchant_id=an_merchant_id
       and a.finish_flag='0'
       and to_char(a.settle_date,'yyyy-mm-dd')>=to_char(sysdate,'yyyy-mm-dd');
       if ai_count is null then
          ai_count:=0;
       end if;

       /*判断商户是否有未结算且结算期大于当日的结算记录*/
       if ai_count=0 then
         begin
          loop
            select count(*)
            into a_count
            from rfms_settle_record a
            where a.id=(select max(b.id) from rfms_settle_record b 
                        where b.merchant_id=a.merchant_id
                        and a.merchant_id=an_merchant_id);
            if a_count > 0 then
              select a.settle_date,a.settle_start,a.settle_end
              into a_settle_date,a_settle_start,a_settle_end
              from rfms_settle_record a
              where a.id=(select max(b.id) from rfms_settle_record b 
                          where b.merchant_id=a.merchant_id
                          and a.merchant_id=an_merchant_id);
            end if;
--dbms_output.put_line('count值为：'||a_count); 
/*          
            if a_settle_end is not null and a_settle_end > sysdate then
               exit;
            end if;*/
            exit when a_settle_end > sysdate;
            /*新商户创建至今日的所有结算空记录*/
            
            if an_settle_period=1 then--日结
               if a_settle_date is null then
                  a2_settle_date:=ad_settle_startdate+1;
                  a2_settle_start:=ad_settle_startdate;
                  a2_settle_end:=ad_settle_startdate+1;
               else
                  a2_settle_date:=a_settle_end+1;
                  a2_settle_start:=a_settle_end;
                  a2_settle_end:=a_settle_end+1;
               end if;
            end if;
            
            if an_settle_period=2 then--周结
               if ai_settle_date<1 or ai_settle_date > 7 then--商户结算日设置错误
                  rtn:=1;
                  exit;
               end if;
               if a_settle_date is null then
                  select next_day(ad_settle_startdate,ai_settle_date) into a2_settle_date from dual;
                  a2_settle_start:=ad_settle_startdate;
                  a2_settle_end:=a2_settle_date;
               else
                  a2_settle_date:=a_settle_end+7;
                  a2_settle_start:=a_settle_end;
                  a2_settle_end:=a_settle_end+7;
               end if;
            end if;
            
            if an_settle_period=3 then--二周结
               if ai_settle_date<1 or ai_settle_date > 7 then--商户结算日设置错误
                  rtn:=1;
                  exit;
               end if;
               if a_settle_date is null then
--                  a2_settle_date:=next_day(ad_settle_startdate,ai_settle_date)+7;
                  select next_day(ad_settle_startdate,ai_settle_date)+7 into a2_settle_date from dual;
                  a2_settle_start:=ad_settle_startdate;
                  a2_settle_end:=a2_settle_date;
               else
                  a2_settle_date:=a_settle_end+14;
                  a2_settle_start:=a_settle_end;
                  a2_settle_end:=a_settle_end+14;
               end if;
            end if;

            if an_settle_period=4 then--月结
               if ai_settle_date<1 or ai_settle_date > 28 then--商户结算日设置错误
                  rtn:=1;
                  exit;
               end if;
               if a_settle_date is null then
                  a2_settle_date:=to_date(to_char(add_months(ad_settle_startdate,1),'yyyy-mm')||'-'||ai_settle_date,'yyyy-mm-dd');
                  a2_settle_start:=ad_settle_startdate;
                  a2_settle_end:=to_date(to_char(add_months(ad_settle_startdate,1),'yyyy-mm')||'-'||ai_settle_date,'yyyy-mm-dd');
               else
                  a2_settle_date:=add_months(a_settle_end,1);
                  a2_settle_start:=a_settle_end;
                  a2_settle_end:=add_months(a_settle_end,1);
               end if;
            end if;

            --生成商户结算记录
            insert into rfms_settle_record(id,merchant_id,settle_date,
                                          settle_start,settle_end,handling_charge,
                                          commision_charge,discount_rate,finish_flag)
            values(seq_rfms_settle_record.nextval,an_merchant_id,
                   a2_settle_date,a2_settle_start,a2_settle_end,
                   an_handling_charge,an_commision_charge,an_discount_rate,'0');

            --生成商户分店结算记录
            open rscursor1 for 
               select b.merchant_branch_id
               from rfms_merchant a,rfms_merchant_branch b
               where a.status='1'
               and a.merchant_id=b.merchant_id
               and a.merchant_id=an_merchant_id;
            loop 
               fetch rscursor1 into an_merchant_branch_id; 
               exit when rscursor1%notfound;
               
               insert into rfms_settle_branch_record(id,settle_record_id,merchant_id,
                                                     merchant_branch_id,settle_date,
                                                     settle_start,settle_end,handling_charge,
                                                     commision_charge,discount_rate)
               values(seq_rfms_settle_branch_record.nextval,seq_rfms_settle_record.currval,
                      an_merchant_id,an_merchant_branch_id,
                      a2_settle_date,a2_settle_start,a2_settle_end,
                      an_handling_charge,an_commision_charge,an_discount_rate);
             end loop;
                                   
          end loop;
         end;
       end if;
  commit;
  end loop;
  EXCEPTION 
    WHEN OTHERS THEN
      rollback; 
      rtn:=1;
      prc_err_log(an_merchant_id,'proc_create_settle_init','初始化商户结算空记录');
      Commit; 
end proc_create_settle_init;

/

--------------------------------------------------------
--  DDL for Procedure PROC_CREATE_SETTLE_PAY
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "PROC_CREATE_SETTLE_PAY" (rtn out integer) is
rsCursor SYS_REFCURSOR;
rscursor_pay_branch1 SYS_REFCURSOR;
a_merchant_id number(10);
a_sys_merchant_code varchar2(255);
a_settle_upperlimit number(19);
a_settle_id number(10);
a_settle_date date;
a_settle_start date;
a_settle_end date;
a_pay_end date;
a_handling_charge number(4,3);
a_commision_charge number(4,3);
a_discount_rate number(4,3);

a1_start date;
a1_end date;
a1_sum_consume number(19);
a1_sum_consume_amount number(19);
a1_sum_reject number(19);
a1_sum_reject_amount number(19);
a1_sum_amount number(19);

a1_handling_amount number(19);
a1_commision_amount number(19);
a1_discount_amount number(19);

a2_do_flag integer;

a3_branch_id number(10);
a3_branch_sysmerchantcode varchar2(255);
a3_sum_consume number(19);
a3_sum_consume_amount number(19);
a3_sum_reject number(19);
a3_sum_reject_amount number(19);
a3_sum_amount number(19);

a3_handling_amount number(19);
a3_commision_amount number(19);
a3_discount_amount number(19);
begin
  rtn:=0;
  open rscursor for 
       select a.merchant_id,a.sys_merchant_code,a.settle_upperlimit,
              b.id,b.settle_date,b.settle_start,b.settle_end,
              b.handling_charge,b.commision_charge,b.discount_rate
       from rfms_merchant a,rfms_settle_record b
       where a.merchant_id=b.merchant_id
       and a.status='1'
       and b.finish_flag='0';
  loop 
       a2_do_flag:=0;
       fetch rscursor into a_merchant_id,a_sys_merchant_code,a_settle_upperlimit,
                           a_settle_id,a_settle_date,a_settle_start,a_settle_end,
                           a_handling_charge,a_commision_charge,a_discount_rate; 
       exit when rscursor%notfound;
       
       select max(a.end_date) into a_pay_end
       from rfms_settle_pay a
       where a.settle_record_id=a_settle_id;
       --已到结算周期的商户
       if a_settle_date <= sysdate then
          --未有支付记录
          if a_pay_end is null then
             a1_start:=a_settle_start;
             a1_end:=a_settle_end;
             a2_do_flag:=1;
          --已有支付记录
          else
             --有支付记录并且支付最后日期小于本结算期终止日，继续计算支付记录
             --否则因为已生成支付记录，直接下一循环
             if a_pay_end < a_settle_end then
                a1_start:=a_pay_end;
                a1_end:=a_settle_end;
                a2_do_flag:=1;
             end if;
          end if;
          
          if a2_do_flag=1 then
            select sum(a.tradecount),abs(sum(a.realamount)) into a1_sum_consume,a1_sum_consume_amount 
            from tbl_clearingresults a
            where a.trade_status=1
            and a.recorddate >= a1_start
            and a.recorddate < a1_end
            and a.org_id in (select b.id from tbl_organization b 
                         where trim(b.uniqueid) in (select trim(c.sys_merchant_code) 
                                              from rfms_merchant_branch c,rfms_settle_branch_record d
                                              where c.merchant_branch_id=d.merchant_branch_id
                                              and d.settle_record_id=a_settle_id)
                         );
            select sum(a.tradecount),abs(sum(a.realamount)) into a1_sum_reject,a1_sum_reject_amount 
            from tbl_clearingresults a
            where a.trade_status=12
            and a.recorddate >= a1_start
            and a.recorddate < a1_end
            and a.org_id in (select b.id from tbl_organization b 
                         where trim(b.uniqueid) in (select trim(c.sys_merchant_code) 
                                              from rfms_merchant_branch c,rfms_settle_branch_record d
                                              where c.merchant_branch_id=d.merchant_branch_id
                                              and d.settle_record_id=a_settle_id)
                         );
            if a1_sum_consume_amount is null then
               a1_sum_consume:=0;
               a1_sum_consume_amount:=0;
            end if;
            if a1_sum_reject_amount is null then
               a1_sum_reject:=0;
               a1_sum_reject_amount:=0;
            end if;
            a1_sum_amount:=a1_sum_consume_amount-a1_sum_reject_amount;
            a1_handling_amount:=a1_sum_amount*a_handling_charge;
            a1_commision_amount:=a1_sum_amount*a_commision_charge;
            a1_discount_amount:=a1_sum_amount*(1-a_discount_rate);
                      
            a1_sum_amount:=a1_sum_amount-a1_handling_amount-a1_commision_amount-a1_discount_amount;
            insert into rfms_settle_pay(id,settle_record_id,start_date,end_date,pay_date,pay_flag,
                                       handling_charge,commision_charge,discount_rate,amount,
                                       handling_charge_amount,commision_charge_amount,discount_amount,
                                       consume_num,consume_amount,rejected_num,rejected_amount)
            values(seq_rfms_settle_pay.nextval,a_settle_id,a1_start,a1_end,a1_end,'0',
                   a_handling_charge,a_commision_charge,a_discount_rate,a1_sum_amount,
                   a1_handling_amount,a1_commision_amount,a1_discount_amount,
                   a1_sum_consume,a1_sum_consume_amount,a1_sum_reject,a1_sum_reject_amount);        

          end if;
       --未到结算周期的商户      
       else
          --未有支付记录
          if a_pay_end is null then
             a1_start:=a_settle_start;
             a1_end:=to_date(to_char(sysdate,'yyyy-mm-dd'),'yyyy-mm-dd');
          --已有支付记录
          else
             a1_start:=a_pay_end;
             a1_end:=to_date(to_char(sysdate,'yyyy-mm-dd'),'yyyy-mm-dd');
          end if;
          select sum(a.tradecount),sum(a.realamount) into a1_sum_consume,a1_sum_consume_amount 
          from tbl_clearingresults a
          where a.trade_status=1
          and a.recorddate >= a1_start
          and a.recorddate < a1_end
          and a.org_id in (select b.id from tbl_organization b 
                       where trim(b.uniqueid) in (select trim(c.sys_merchant_code) 
                                            from rfms_merchant_branch c,rfms_settle_branch_record d
                                            where c.merchant_branch_id=d.merchant_branch_id
                                            and d.settle_record_id=a_settle_id)
                       );
          select sum(a.tradecount),sum(a.realamount) into a1_sum_reject,a1_sum_reject_amount 
          from tbl_clearingresults a
          where a.trade_status=12
          and a.recorddate >= a1_start
          and a.recorddate < a1_end
          and a.org_id in (select b.id from tbl_organization b 
                       where trim(b.uniqueid) in (select trim(c.sys_merchant_code) 
                                            from rfms_merchant_branch c,rfms_settle_branch_record d
                                            where c.merchant_branch_id=d.merchant_branch_id
                                            and d.settle_record_id=a_settle_id)
                       );
          if a1_sum_consume_amount is null then
             a1_sum_consume:=0;
             a1_sum_consume_amount:=0;
          end if;
          if a1_sum_reject_amount is null then
             a1_sum_reject:=0;
             a1_sum_reject_amount:=0;
          end if;
          
          a1_sum_amount:=a1_sum_consume_amount-a1_sum_reject_amount;
          a1_handling_amount:=a1_sum_amount*a_handling_charge;
          a1_commision_amount:=a1_sum_amount*a_commision_charge;
          a1_discount_amount:=a1_sum_amount*(1-a_discount_rate);
          
          --需支付金额已达到支付金额上限则生成支付记录
          if a1_sum_amount > a_settle_upperlimit then
            a2_do_flag:=1;
            a1_sum_amount:=a1_sum_amount-a1_handling_amount-a1_commision_amount-a1_discount_amount;
            insert into rfms_settle_pay(id,settle_record_id,start_date,end_date,pay_date,pay_flag,
                                       handling_charge,commision_charge,discount_rate,amount,
                                       handling_charge_amount,commision_charge_amount,discount_amount,
                                       consume_num,consume_amount,rejected_num,rejected_amount)
            values(seq_rfms_settle_pay.nextval,a_settle_id,a1_start,a1_end,a1_end,'0',
                   a_handling_charge,a_commision_charge,a_discount_rate,a1_sum_amount,
                   a1_handling_amount,a1_commision_amount,a1_discount_amount,
                   a1_sum_consume,a1_sum_consume_amount,a1_sum_reject,a1_sum_reject_amount);        
                   
            

          end if;
       end if;
    --有生成商户支付记录的同时生成门店的支付记录
    if a2_do_flag=1 then
      open rscursor_pay_branch1 for 
           select b.merchant_branch_id,b.sys_merchant_code
           from rfms_settle_record a,rfms_merchant_branch b
           where a.merchant_id=b.merchant_id
           and a.id=a_settle_id;
      loop
      
        fetch rscursor_pay_branch1 into a3_branch_id,a3_branch_sysmerchantcode; 
        exit when rscursor_pay_branch1%notfound;
        select sum(a.tradecount),abs(sum(a.realamount)) into a3_sum_consume,a3_sum_consume_amount 
        from tbl_clearingresults a
        where a.trade_status=1
        and a.recorddate >= a1_start
        and a.recorddate < a1_end
        and a.org_id in (select b.id from tbl_organization b 
                     where trim(b.uniqueid) = trim(a3_branch_sysmerchantcode)
                     );
        select sum(a.tradecount),abs(sum(a.realamount)) into a3_sum_reject,a3_sum_reject_amount 
        from tbl_clearingresults a
        where a.trade_status=12
        and a.recorddate >= a1_start
        and a.recorddate < a1_end
        and a.org_id in (select b.id from tbl_organization b 
                     where trim(b.uniqueid) = trim(a3_branch_sysmerchantcode)
                     );
        if a3_sum_consume_amount is null then
           a3_sum_consume:=0;
           a3_sum_consume_amount:=0;
        end if;
        if a3_sum_reject_amount is null then
           a3_sum_reject:=0;
           a3_sum_reject_amount:=0;
        end if;
                
        a3_sum_amount:=a3_sum_consume_amount-a3_sum_reject_amount;
        a3_handling_amount:=a3_sum_amount*a_handling_charge;
        a3_commision_amount:=a3_sum_amount*a_commision_charge;
        a3_discount_amount:=a3_sum_amount*(1-a_discount_rate);
                
        a3_sum_amount:=a3_sum_amount-a3_handling_amount-a3_commision_amount-a3_discount_amount;
        insert into rfms_settle_pay_branch(id,pay_id,merchant_branch_id,start_date,end_date,pay_date,pay_flag,
                                   handling_charge,commision_charge,discount_rate,amount,
                                   handling_charge_amount,commision_charge_amount,discount_amount,
                                   consume_num,consume_amount,rejected_num,rejected_amount)
        values(seq_rfms_settle_pay_branch.nextval,seq_rfms_settle_pay.currval,a3_branch_id,
               a1_start,a1_end,a1_end,'0',
               a_handling_charge,a_commision_charge,a_discount_rate,a3_sum_amount,
               a3_handling_amount,a3_commision_amount,a3_discount_amount,
               a3_sum_consume,a3_sum_consume_amount,a3_sum_reject,a3_sum_reject_amount);        
                
      end loop;
   end if;       
  commit;     
  end loop;

  EXCEPTION 
    WHEN OTHERS THEN
      rollback; 
      rtn:=1;
      prc_err_log(a_merchant_id,'proc_create_settle_pay','生成支付记录');
      Commit; 

end proc_create_settle_pay;

/

--------------------------------------------------------
--  DDL for Procedure PROC_CREATE_SETTLE_RECORD
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "PROC_CREATE_SETTLE_RECORD" (rtn out integer) is
