--------------------------------------------------------
--  DDL for Procedure PROC_SUM_MERCHANT_AMOUNT
--------------------------------------------------------
set define off;

  CREATE OR REPLACE PROCEDURE "PROC_SUM_MERCHANT_AMOUNT" (rtn out integer) is
rsCursor SYS_REFCURSOR;
an_merchant_id number(10);--商户ID
an_total_amount number(19);--卡系统内商户号
an_commision_step_id number(14);
an_commision_charge number(4,3);
begin
  rtn:=0;
  open rscursor for 
       select a.merchant_id,abs(sum(b.amount))
       from rfms_merchant_branch a,tbl_clearingresults b,tbl_organization c
       where trim(a.sys_merchant_code)=trim(c.uniqueid)
       and b.org_id=c.id
       and b.trade_status=1
       group by a.merchant_id;
  loop 
       fetch rscursor into an_merchant_id,an_total_amount; 
       exit when rscursor%notfound;
       
       select a.commision_charge,a.commision_step_id into an_commision_charge,an_commision_step_id
       from rfms_commision_step a
       where a.merchant_id=an_merchant_id
       and a.min_charge<=(an_total_amount/100)
       and a.max_charge>(an_total_amount/100);
       
       if an_commision_charge is null then
          rtn:=1;
       end if;
       
       if an_commision_charge > 0 then
          --更新商户信息表
          update rfms_merchant a 
          set a.commision_charge=an_commision_charge
          where a.merchant_id=an_merchant_id;
          --更新商户结算表
          update rfms_settle_record a
          set a.commision_charge=an_commision_charge
          where a.merchant_id=an_merchant_id
          and a.finish_flag='0';
          --更新商户分店结算表
          update rfms_settle_branch_record a
          set a.commision_charge=an_commision_charge
          where a.settle_record_id in (select b.id from rfms_settle_record b
                                       where a.merchant_id=an_merchant_id
                                       and b.finish_flag='0');

 
      end if;
  commit;
  end loop;

    EXCEPTION 
    WHEN OTHERS THEN
      rollback; 
      rtn:=1;
      prc_err_log(an_merchant_id,'proc_sum_merchant_amount','根据累计交易金额重新计算佣金');
      Commit; 
end proc_sum_merchant_amount;

/

